// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './Home';
import inicioRegistro from './inicioRegistro';
import RegistroDiscapacitados from './RegistroDiscapacitados';
import RegistroAcompanantes from './RegistroAcompanantes';
import RegistroConductores from './RegistroConductores';
import './styles/index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/inicioRegistro" element={<Registro />} />
      <Route path="/RegistroDiscapacitados" element={<RegistroDiscapacitados />} />
      <Route path="/RegistroAcompanantes" element={<RegistroAcompanantes />} />
      <Route path="/RegistroConductores" element={<RegistroConductores />} />
      {/* <Route path="/login" element={<Login />} /> si tienes un login luego lo conectamos */}
    </Routes>
  </BrowserRouter>
);
